class Video {  final String id;  final String title;  final String? uploader;  final String? thumbnail;  final DateTime? publishedAt;  String? publishedAtStr;  final String? description;  Video(      {required this.title,      required this.id,      this.uploader,      this.thumbnail,      this.publishedAt,      this.publishedAtStr,      this.description}) {    if (this.publishedAtStr == null || this.publishedAtStr == "Unknown") {      this.publishedAtStr = this.publishedAt?.toString();    }  }  @override  String toString() {    return 'ID: $id , Title: $title, Uploader: $uploader, Published At: $publishedAtStr';  }}